    const {photo,userId,userEmail,tourName,fullName,guestSize,bookAt} = booking;

    return <div className='tour__card'>
    <Card>
        <div className="tour__img">
            <img src={photo} alt='tour-img' />
        </div>

        <CardBody>
            <h3></h3>
    

        </CardBody>

    </Card>
    </div>
};

export default BookingCard;
